export function add36(a: number, b: number): number {
  return a + b;
}

export function subtract36(a: number, b: number): number {
  return a - b;
}

export function multiply36(a: number, b: number): number {
  return a * b;
}

export function divide36(a: number, b: number): number {
  return a / b;
}
